import React from 'react'
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

const SingleArrangement = ({a}) => {
  return (


<div classNameName='arrangement'>
        {/* <img classNameName='arrangement-img-top' src={arrangement.url} alt="Arrangement"/> */}
        <div classNameName="bg-image hover-overlay ripple" data-mdb-ripple-color="light">
        <img classNameName='arrangement-img-top' src={a.url} alt="Arrangement"/>

            <h3 classNameName='arrangement-name'>{a.name}</h3>
            <h3 classNameName='arrangement-description'>{a.description}</h3>
            <h5 classNameName='arrangement-price'>{a.price}</h5>
            </div>
        
            <div className="card-body">
    <h5 className="card-title">Card title</h5>
    <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
    <a href="#!" className="btn btn-primary">Button</a>
  </div>

        <div classNameName='button-section'>
         

          {/* <input type="number" name="quantity" classNameName='quantity'
                  min="1" max="5" step="1" defaultValue="1" onChange={handleInput}>
          </input> */}
          <button classNameName="arrangement-button" >
          </button>
        </div>
       

    </div>


    )
}

export default SingleArrangement
